  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108227 includes biological,
  chemical, meteorological, physical and underway - surface data collected from MARION
  DUFRESNE in the Indian Ocean from 2009-01-04 to 2009-02-09 and retrieved during
  cruise 35MF20090104. These data include BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR,
  FLUORESCENCE, Partial pressure (or fugacity) of carbon dioxide, SALINITY and SEA
  SURFACE TEMPERATURE. The instruments used to collect these data include Carbon dioxide
  (CO2) gas analyzer and Thin film type equilibrator for autonomous carbon dioxide
  (CO2) measurement. These data were collected by Nicolas Metzl of Universite Pierre
  et Marie Curie; Institut Pierre Simon Laplace; Laboratoire D'Oceanographie et du
  Climat: Experimentations et Approches Numeriques as part of the OISO-17 data set.nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
